(7, 'Setters Movie Review {2.5 /5}: Critic Review of Setters by', 'The film follows the cat and mouse game between friends-turned-foes â€” cop Aditya (Aftab Shivdasani) and a setter Apurva (Shreyas Talpade), who heads and orchestrates an exam leaking cartel in north India.', 'https://timesofindia.indiatimes.com/entertainment/hindi/movie-reviews/setters/movie-review/69149034.cms', 'times.jpeg', '2023-09-16 11:19:44'),
(8, 'Setters (2019) - IMDb', 'A thriller set in Benares, Jaipur, Mumbai and Delhi, Setters is about a racket profiteering from ...', 'https://www.imdb.com/title/tt9239772/', 'setters.jpg', '2023-09-16 11:19:44'),
(9, 'Setters movie review: An insipid Aftab Shivdasani meets an ...', '\"Kaahe Labadh-Labadh Kar Raha Hai?\" Sounds So Much More Colourful Than Its English Translations \"Why Are You Blabbering?\" Or \"Why Are You Talking Rubbish?\" Siraj Ahmed\'s Hindi Dialogues, Rooted In The Soil Of Varanasi, Are Among  The Nicer Elements In Setters, A Film Set In The Holy City Amidst An Unholy Bunch Of Locals Running An Exam Paper Leaking Racket.', 'https://www.firstpost.com/entertainment/bollywood/setters-movie-review-an-insipid-aftab-shivdasani-meets-an-impressive-shreyas-talpade-6562681.html', 'Firstblog.jpg', '2023-09-16 11:19:44'),
(10, '\'Setters\' review: A choppy crime-comedy that fails on most fronts', 'Setters is a Neeraj Pandey movie directed by someone else (Ashwini Chaudhary), one that features Shreyas Talpade and Aftab Shivdasani in place of Akshay Kumar and Manoj Bajpayee. The film looks into the insidious exam-setting scam in the capital cities of Northern India.', 'https://www.newindianexpress.com/entertainment/review/2019/may/04/setters-review-a-choppy-crime-comedy-that-fails-on-most-fronts-1972329.html', 'indianexp.jpg', '2023-09-16 11:19:44'),
